import React, { useEffect } from 'react';
import { Carousel, Image } from 'react-bootstrap';
import lorraine from "../assets/Lorraine_carosel_pic.png"
import "./Carosel.css"
const Carousels = () => {
 

  let currentIndex = 0;
  const totalSlides = document.querySelectorAll('.carouselslides').length;
  const carousel = document.querySelector('.carousel');

  function nextSlide() {
    currentIndex = (currentIndex + 1) % totalSlides;
    updateCarousel();
  }

  function prevSlide() {
    currentIndex = (currentIndex - 1 + totalSlides) % totalSlides;
    updateCarousel();
  }

  function updateCarousel() {
    const translateValue = -currentIndex * 270; // Adjust the value based on card width + margin
    carousel.style.transform = `translateX(${translateValue}px)`;
  }

  return (
    <div class="container">
    <div class="row">
        <div class="col-md-4 col-sm-6">
            <div class="our-team">
                <div class="pic">
                    <img src="https://images.pexels.com/photos/157646/title-photo-logo-shirt-157646.jpeg?w=940&h=650&auto=compress&cs=tinysrgb" alt="team member" class="img-responsive"/>
                </div>
                <div class="content">
                    <h3 class="title">Peter Johns</h3>
                    <span class="post">Web Developer</span>
                    <ul class="social">
                        <li><a href="#" class="fa fa-facebook"></a></li>
                        <li><a href="#" class="fa fa-twitter"></a></li>
                        <li><a href="#" class="fa fa-linkedin"></a></li>
                    </ul>
                </div>
            </div>
        </div>

        <div class="col-md-4 col-sm-6">
            <div class="our-team active">
                <div class="pic">
                    <img src="https://static.pexels.com/photos/38554/girl-people-landscape-sun-38554.jpeg" alt="team member" class="img-responsive"/>
                </div>
                <div class="content">
                    <h3 class="title">Kelli Smith</h3>
                    <span class="post">Web Developer</span>
                    <ul class="social">
                        <li><a href="#" class="fa fa-facebook"></a></li>
                        <li><a href="#" class="fa fa-twitter"></a></li>
                        <li><a href="#" class="fa fa-linkedin"></a></li>
                    </ul>
                </div>
            </div>
        </div>
       <div class="col-md-4 col-sm-6">
            <div class="our-team">
                <div class="pic">
                    <img src="https://images.pexels.com/photos/157646/title-photo-logo-shirt-157646.jpeg?w=940&h=650&auto=compress&cs=tinysrgb" alt="team member" class="img-responsive"/>
                </div>
                <div class="content">
                    <h3 class="title">Peter Johns</h3>
                    <span class="post">Web Developer</span>
                    <ul class="social">
                        <li><a href="#" class="fa fa-facebook"></a></li>
                        <li><a href="#" class="fa fa-twitter"></a></li>
                        <li><a href="#" class="fa fa-linkedin"></a></li>
                    </ul>
                </div>
            </div>
        </div>
    </div>
</div>
  );
};

export default Carousels;
